use ascon_aead::{
    aead::{Aead, AeadInPlace, KeyInit, Payload},
    Ascon128, Ascon128a, Ascon80pq,
};
use hex_literal::hex;

fn run_tv<A: KeyInit + AeadInPlace>(
    key: &[u8],
    nonce: &[u8],
    plaintext: &[u8],
    associated_data: &[u8],
    ciphertext: &[u8],
) {
    let core = A::new(key.try_into().unwrap());
    let ctxt = core
        .encrypt(
            nonce.try_into().unwrap(),
            Payload {
                msg: plaintext,
                aad: associated_data,
            },
        )
        .expect("Successful encryption");
    assert_eq!(ctxt, ciphertext);

    let ptxt = core
        .decrypt(
            nonce.try_into().unwrap(),
            Payload {
                msg: ciphertext,
                aad: associated_data,
            },
        )
        .expect("Successful decryption");
    assert_eq!(ptxt, plaintext);
}

#[test]
fn test_ascon128_1() {
    run_tv::<Ascon128>(
        &hex!("000102030405060708090A0B0C0D0E0F"),
        &hex!("000102030405060708090A0B0C0D0E0F"),
        &hex!(""),
        &hex!(""),
        &hex!("E355159F292911F794CB1432A0103A8A"),
    )
}

